import moment from "moment";

export function saveDomainInfoFormToDatabase(
  siteRegistredFromDate,
  endOfActivityDate,
  siteName,
  domainOwner,
  personForPayment,
  personForAdministration
) {
  console.log(siteRegistredFromDate);
  console.log(moment(siteRegistredFromDate).format("DD-MM-YYYY"));

  console.log(endOfActivityDate);
  console.log(moment(endOfActivityDate).format("DD-MM-YYYY"));

  console.log(siteName);
  console.log(domainOwner);
  console.log(personForPayment);
  console.log(personForAdministration);
}

export function getDomainInfoDataFromDatabase() {
  return {
    siteRegistredFromDate: moment("25.09.2019")
      .format("DD-MM-YYYY")
      .toDate(),
    //siteRegistredFromDate: new Date(),
    endOfActivityDate: new Date(),

    data: {
      siteName: "4",
      domainOwner: "5",
      personForPayment: "6",
      personForAdministration: "7"
    }
  };
}
